import React, { useEffect, useState } from 'react';
import axios from 'axios';
import POINTS from '../assets/TIMELINE.png'
import NOLOGO from '../assets/NO LOGO.png'


function Projects() {

  const [projectData, setProjectData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get('http://localhost:8080/api/projects')
      .then((response) => {
        console.log('API response:', response.data); // Log the data to debug
        setProjectData(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching project data:', error);
        setLoading(false);
      });
  }, []);
  return (
    <div className='px-20 pt-20 grid grid-cols-12 gap-4'>

      <div className='justify-items-center'>
        <img src={POINTS} alt="" />
      </div>



      <div className='col-span-4 grid grid-rows-4 justify-items-start '>
          <div >
          {projectData.map((entry, index) => (
            <div key={index} className="content-start hover:cursor-pointer">
              <div className="text-2xl font-semibold mb-3">{entry.heading}</div>
              <div>{entry.subHeading}</div>
              <div>Tools: {entry.tools}</div>
            </div>
          ))}
            </div>

      </div>
      <div className="col-start-8 col-end-12 bg-zinc-800 rounded-xl justify-items-center content-center">
        <img src={NOLOGO} alt="" />
      </div>

    </div> 
  )
}

export default Projects;
